import React from "react";
import './style.css';

import By from './by.png';
import discord from './icons/discord_icon.png';

export default function Footer(){
    return (
        <>
            <hr />
            <div className="d-flex">
                <img src={By} alt="" srcset="" />
                <h1>a</h1>
            </div>
            <hr />
        </>
    );
}
